(2840, 'KITAB TAUHID', '<p><img alt="KITAB TAUHID" src="http://www.gohijrah.com/wp-content/uploads/2017/09/8610051_3b13e7e6-7ff1-4b14-85b1-89a92820e8bc.jpg" /><br />\nBISMILLAH</p>\n\n<p>INFO KAJIAN UNTUK UMUM MASJID AL FURQON MANUKAN</p>\n\n<p>&nbsp;</p>\n\n<p>MATERI</p>\n\n<p>&quot; KITAB TAUHID&quot;</p>\n\n<p>&nbsp;</p>\n\n<p>PEMATERI</p>\n\n<p>Ustadz Fadlan Fahamsyah, Lc, MHI.</p>\n\n<p>WAKTU Insya Alloh Hari: AHAD Jam: Ba&#39;da Maghrib - selesai</p>\n\n<p>&nbsp;</p>\n\n<p>TEMPAT</p>\n\n<p>MASJID AL FURQON</p>\n\n<p>Jl. Manukan ( pasar sikatan samping bakso sadam ) Tandes, Surabaya.</p>\n\n<p>Peta Lokasi : https://goo.gl/maps/gK54GJsfMVm</p>\n\n<p>&nbsp;</p>\n\n<p>CP/INFO</p>\n\n<p>082134342610 ( P.Mul )</p>\n\n<p>~~~~~</p>\n\n<p>&nbsp;Ayoo... Ajak ikut serta Keluarga &amp; Sahabat Muslim lainnya untuk mendatangi Taman - Taman Surga (Majelis ilmu)</p>\n\n<p>Ù…ÙŽÙ†Ù’ ÙŽØ¯Ù„Ù‘ÙŽ Ø¹ÙŽÙ„ÙŽÙ‰ Ø®ÙŽÙŠÙ’Ø±Ù ÙÙŽÙ„ÙŽÙ‡Ù Ù…ÙØ«Ù’Ù„Ù Ø£ÙŽØ¬Ù’Ø±Ù ÙÙŽØ§Ø¹ÙÙ„ÙÙ‡Ù ÄºÄºl</p>\n\n<p>&quot;Barang siapa menunjukkan kepada kebaikan, maka ia mendapatkan pahala sebagaimana orang yang melakukan.&quot; [HR. Muslim, 3509]</p>\n\n<p>Semoga ALLOH TA&#39;ALA mudahkan langkah kita untuk mendatangi majelis ilmu.</p>\n', 1506086507, '', '', 1519132860, 0, 1506086507, 1, 1519612303, 1, NULL, NULL, 'kitab-tauhid', 6, NULL, NULL),
(2863, 'JANGAN BIARKAN NIKMAT BERUBAH MENJADI AZAB', '<p><a data-rel="penci-gallery-image-content" href="http://www.gohijrah.com/wp-content/uploads/2017/09/rainfall2.jpg"><img alt="" height="767" sizes="(max-width: 1170px) 100vw, 1170px" src="http://www.gohijrah.com/wp-content/uploads/2017/09/rainfall2-1170x767.jpg" srcset="http://www.gohijrah.com/wp-content/uploads/2017/09/rainfall2-1170x767.jpg 1170w, http://www.gohijrah.com/wp-content/uploads/2017/09/rainfall2-300x197.jpg 300w, http://www.gohijrah.com/wp-content/uploads/2017/09/rainfall2-768x503.jpg 768w, http://www.gohijrah.com/wp-content/uploads/2017/09/rainfall2-1024x671.jpg 1024w, http://www.gohijrah.com/wp-content/uploads/2017/09/rainfall2-585x383.jpg 585w, http://www.gohijrah.com/wp-content/uploads/2017/09/rainfall2.jpg 1589w" width="1170" /></a></p>\n\n<p>Bismillah&hellip;.</p>\n\n<p>&nbsp;</p>\n\n<p>Kajian rutin Jumat pagi untuk Umum Ikhwan /Akhwat</p>\n\n<p>yang Ø§Ù Ù†Ù’ Ø´ÙŽØ¢ Ø¡ÙŽ Ø§Ù„Ù„Ù‘Ù‡Ù&nbsp;&nbsp; diselenggarakan pada :</p>\n\n<p>&nbsp;Jumat , 9 Muharam 1439 H/ 29 September&nbsp; 2017</p>\n\n<p>&nbsp;</p>\n\n<p>Tempat :</p>\n\n<p>&nbsp;Jl. Pepelegi Indah H &ndash; 22 Waru Sidoarjo</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;Waktu 08.15</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;Bersama :</p>\n\n<p>Ustadz Abu Ghozie As Sundawie</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;Materi :</p>\n\n<p>jangan biarkan nikmat berubah menjadi azab</p>\n\n<p>&nbsp;</p>\n\n<p>&nbsp;</p>\n\n<p>&ldquo;Barangsiapa menunjukkan kebaikan, maka ia mendapatkan pahala sebagaimana orang yang melakukan.&rdquo;</p>\n\n<p>[HR. Muslim, 3509].</p>\n\n<p>&nbsp;</p>\n\n<p>Datang dengan mengharap Ridho Allah Ta&rsquo;ala semata.</p>\n\n<p>Ù</p>\n\n<p>&ldquo;Barangsiapa menempuh sebuah jalan untuk menuntut ilmu maka Allah akan mudahkan untuknya jalan menuju Surga&rdquo;</p>\n\n<p>(HR. Muslim No.2699)</p>\n\n<p>&nbsp;</p>\n\n<p>Jazakumullah Khairan Katsira&hellip;.</p>\n', 1506566825, '', '', 1519094820, 0, 1506566825, 1, 1519612303, 1, NULL, NULL, 'jangan-biarkan-nikmat-berubah-menjadi-azab', 4, NULL, NULL),
